/**
 * Create a new JSON object to post from a post that previously failed
 * @param args - JMeter args 
 */
function rePostFailedPost( args ) {
	log.info( "rePostFailedPost: Posting failed JSON Post" );
	
	// Assign the previously failed post
	if( clockingPost != null ) {
		var failedPost = [];
		failedPost.push( clockingPost );
		vars.put( "failedPost", JSON.stringify( failedPost ));	
	} else if( orderPost != null ){
		vars.put( "failedPost", JSON.stringify( orderPost ));
	}
	
}

/**
 * Valid actions for this script.  JMeter passes
 * the action into this script via args[0]
 */
var VALID_ACTIONS = {
    "rePostFailedPost" : rePostFailedPost
};

//The args array passed into this script from JMeter controls
//what this script will do.
//args[0] = action
//args[1..n] = optional parameters for action
var action = args[0];
VALID_ACTIONS[action]( args );
